import time

def timeit(method):
    def timed(*args, **kw):
        ts = time.time()
        result = method(*args, **kw)
        te = time.time()
        if 'log_time' in kw:
            name = kw.get('log_name', method.__name__.upper())
            kw['log_time'][name] = int((te - ts) * 1000)
        else:
            print('%r  %2.2f ms' % \
                  (method.__name__, (te - ts) * 1000))
        return result
    return timed

class Solution:
    @timeit

    
    def subarrayBitwiseORs(self, A) -> int:
        self.output = set()
        if 1:

            # sweep
            # for i in range(0, len(A)):
            #    or_res = or_res | A
            #    self.output.add(or_res)

            # B = set()
            d = 0
            # a_or = []
            # or_res = 0
            # last_res = 0
            # a_or.append(A[0])
            # for i in range(1, len(A)):
            #     or_res = A[i-1] | A[i]
            #     if or_res != last_res:
            #         a_or.append(A[i])
            #         last_res = or_res

            # or_up_to_dict = [0] * len(A)
            or_up_to_dict = {}
            or_res = 0
            for i in range(len(A) - 1, -1, -1):
                or_res = or_res | A[i]
                or_up_to_dict[i] = or_res
                # debug = (A[i],)
                self.output.add(A[i])
                d += 1


#                last_or_res = or_res
                

            last_level_0_or_res = -1
            for i in range(0, len(A)):
                or_res = A[i]
#                debug = (A[i],)
#                self.output.add(or_res)
#                d += 1
                last_or_res = or_res


                last_level_0_or_res = or_up_to_dict[i]

#                for j in range(i + 1, len(A)):
#                    or_res = or_res | A[j]
#                last_level_0_or_res = or_res
                for j in range(i + 1, len(A)):
                    or_res = or_res | A[j]
                    # debug = debug + (A[j],)
                    # B.add(debug)
            
                    # print(f'b:{debug} or_res:{or_res}')
                    if or_res != last_or_res:
                        self.output.add(or_res)
                        d += 1
                        last_or_res = or_res

                    if or_res == last_level_0_or_res:
                        break
#                last_level_0_or_res = or_res
            
            # print(f' len(B):{len(B)} iterations:{d}') 
            print(f' num inserts:{d}') 
            return len(self.output)


        def or_chain(L):
           result = 0
           for x in L:
                result = result | x 

           return result
    
        
        def dfs(sub_array, depth):
            if not sub_array:
                return 0
            if len(sub_array) > 0:
                self.output.add(or_chain(sub_array))
            if len(sub_array) == 1:
                return or_chain(sub_array)
            
            n = len(sub_array)
            mid_point = n // 2
            left = sub_array[:mid_point]
            right = sub_array[mid_point:]

            print(f'left: {left}, right: {right} depth: {depth}')
            
            or_left = dfs(left, depth + 1)
            or_right = dfs(right, depth + 1)

            
            # sweep
            for i in range(0, len(left)):
                or_left = or_chain(left[i:])
                or_right = right[0]
                self.output.add(or_left | or_right)
                # for j in range(1, len(right)+1):
                for j in range(1, len(right)):
                    or_right = or_right | right[j]
                    self.output.add(or_left | or_right)
                    # B = [x for x in left[i:]] + [x for x in right[0:j]]
                    # self.output.add(or_chain(B))
                        
        dfs(A, 0)
        
        return len(self.output)


